import Expences from "./components/Expences";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: "$950.40",
      date: new Date(2021, 3, 26),
    },
    {
      id: "e2",
      title: "Life Insurance",
      amount: "$9150.40",
      date: new Date(2021, 3, 26),
    },
    {
      id: "e3",
      title: "Bike Insurance",
      amount: "$450.40",
      date: new Date(2021, 3, 26),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expences expenses={expenses} />
    </div>
  );
}

export default App;
